import React from 'react';
import { CardNumberElement } from '@stripe/react-stripe-js';
import {
  injectStripe,
  CardElement,
  ReactStripeElements,
} from 'react-stripe-elements';
function Form() {
  return (
    <div className="container">
      <div className="row">
        <div className="col s6 m6 l6">
          <CardNumberElement />
        </div>
      </div>
    </div>
  );
}

export default Form;
